A '''supply crate''' is obtained after earning at least 500 points during the fight against the [[Wintertodt]]. It can reward many useful items for skilling such as ores, logs, herbs, seeds, gems, and fish. The supply crate also gives the opportunity for items only obtainable through defeating the Wintertodt, such as the [[tome of fire]], [[pyromancer outfit]], and the sought after [[phoenix]] pet.

Opening it will give players two rolls on the reward table. For every 500 points earned after the initial 500, another reward is added to the crate. With 13,500 points or above, players will receive 28 reward rolls, the ''maximum'' from any single supply crate. Beyond this point, earning extra points does not increase the number of rewards from a supply crate.

Players can exchange excess Wintertodt-unique items (excluding [[phoenix]] and [[burnt page]]s) with [[Ignisia]] for an [[extra supply crate]] (which contains one roll on the drop table and no chance of getting a unique item) or 50 burnt pages. Tomes of fire may also be exchanged for 250 burnt pages.

==Drop mechanic==
Points earned between the 500-point milestones will provide players a chance to receive an additional reward equivalent to the progress towards the next milestone. For every 5 points past 500 points player gets 1% extra chance to get additional loot. For example:

*500 points = 2 rolls
*505 points = 2 rolls + 1% chance of an extra roll
*750 points = 2 rolls + 50% chance of an extra roll
*1000 points = 3 rolls
*1005 points = 3 rolls + 1% chance of an extra roll
*1500 points = 4 rolls

===Material quality===
Points earned do not affect the ''quality'' of each drop, only the number of rolls on the drop table. If a material drop is selected (herbs, ores, fish, gems, seeds, and logs), the chances of obtaining a higher quality drop depends upon players' level in its associated skill; Herblore, Mining, Fishing, Crafting, Farming, and Woodcutting respectively.{{CiteTwitter|author=Mod Ash|url=https://twitter.com/JagexAsh/status/1051830039346597888|date=15 October 2018|archiveurl=https://archive.is/TuGRi|archivedate=30 May 2020|quote=Yes, Kieren spoke truth. Also Woodcutting.}} At the highest point, low levelled materials are removed from the drop table. While players with low levels in those skills can get rare materials, the drop rate is very low, but will increase with that skill level.

Because the rewards are determined when opening the crate{{CiteTwitter|author=Mod Ash|url=https://twitter.com/JagexAsh/status/970390094959046657|date=4 March 2018|archiveurl=https://archive.is/odUTS|archivedate=30 May 2020|quote=Correct, the loot is determined when you open it.}}, players can choose to keep them closed until their relevant skills are at a higher level, allowing them to receive rarer materials and supplies from the crate when they eventually do open them. Do note that supply crates '''do not''' stack in a [[bank]]; as such, storing too many supply crates may consume too much bank space.

===Reward rolls===
The supply crate uses a special mechanic to determine items obtained. When the crate is opened, a drop will be rolled for until the roll results in a success, as described in the table below.{{CiteVideo|author=Old School RuneScape|title=Loot from 1,000 Wintertodt Supply Crates!|url=jjNWdnObcrs&t=2509|timestamp=41:49|date=21 September 2016|site=YouTube|notes=In this video Mod Kieren and Mod Ronan list the rarities of the uniques.|name=Loot from 1,000 video}}

Note that the success rate is the rate per roll, and players are given at least two rolls per crate, depending on the points gained at the end of the fight.

For example, a player opens the crate and rolls for a dragon axe. If successful, the player will receive a dragon axe. If unsuccessful, then the player will then roll for a phoenix. If that roll is successful, they will receive the phoenix and the drop rolls end there. If unsuccessful, the player will roll for the tome of fire, then the warm gloves, and so on. If none of the unique drop rolls are successful, then the player will receive an item from the normal drop table, which contains burnt pages, seeds, logs, etc. It is possible to receive more than 3 sets of the Pyromancer outfit (Garb, Hood, Robe, Boots).
